import React from 'react';
import { Route, Navigate } from 'react-router-dom';
let auth;
auth= true;
auth=null;
const PrivateRoute = ({ component: Component }) => {
    return auth ? <Component /> : <Navigate to="/login" />;
 };

export default PrivateRoute;
